import React from 'react'

function H1() {
  return (
   <h1 className="mb-1"></h1>
  )
}

function H2() {
  return (
   <h2 className="text-h4 mb-3"></h2>
  )
}

function H6() {
  return (
   <h6 className="text-5xl mb-3"></h6>
  )
}

const Heading = {
  H1: H1,
  H2: H2,
  H6: H6
}

export { Heading }
